//Giving the essential buttons, image elements and paragraph elements a variable name
const nextMusic = $("#foward");
const previousMusic = $("#backward");
const musics = $("#audio");
const musicTitle = $("#paragraph");
const coverImage = $("#coverPhoto");

//creating a variable as array guide
//I would have used state instead of var on react
var count = 1;

//Creating the function to respond to the web app on button clicks and key clicks
//The previous function returns the music to the former music in the music array while the next function fowards it to the next array
function previous() {
  if (count > 1) {
    count--;
    var musicCount = musicArray[count].music;
    musics.attr("src", musicCount);
    var imageCount = musicArray[count].image;
    coverImage.attr("src", imageCount);
    musicTitle.html(musicArray[count].name);
  } else if ((count = 1)) {
    count = count + 17;
    count--;
    var musicCount = musicArray[count].music;
    musics.attr("src", musicCount);
    var imageCount = musicArray[count].image;
    coverImage.attr("src", imageCount);
    musicTitle.html(musicArray[count].name);
  } else {
    return null;
  }
}

function next() {
  if (count < 17) {
    count++;
    var musicCount = musicArray[count].music;
    musics.attr("src", musicCount);
    var imageCount = musicArray[count].image;
    coverImage.attr("src", imageCount);
    musicTitle.html(musicArray[count].name);
  } else if ((count = 17)) {
    count = count - 17;
    count++;
    var musicCount = musicArray[count].music;
    musics.attr("src", musicCount);
    var imageCount = musicArray[count].image;
    coverImage.attr("src", imageCount);
    musicTitle.html(musicArray[count].name);
  } else {
    return null;
  }
}

//Creating the on button click event listeners using the previously created functions and JQuery
nextMusic.click(next);
previousMusic.click(previous);

//Creating the on Keyboard key press function for the keys "n" and "p"
function check(key) {
  switch (key) {
    case "n":
      next();
      break;

    case "p":
      previous();
      break;

    default:
      return null;
      break;
  }
}

//Adding event listener to the entire html file so as to detect the essential keyboard key presses
document.addEventListener("keyup", function (a) {
  if (a.keyCode == 37) {
    previous();
  } else if (a.keyCode == 39) {
    next();
  }
});

document.addEventListener("keydown", function () {
  check(event.key);
});

